Asteroids isn't too much fun with just a player in the world. Let's create a system for spawning Asteroids in a random position with a random velocity! We are now going to use the rand crate that we added to our dependencies. Please note that the first half of this system randomizes the position and velocity for the asteroid. const WINDOW_X: f32 = 1280.;
const WINDOW_Y: f32 = 720.; const ASTEROID_COLOR: Color = Color::rgb(0.0, 1.0, 1.0); fn spawn_asteroid(mut commands: Commands) { let rand_angle: f32 = rand::random::<f32>() * 2. * PI; let rand_vel: f32 = rand::random::<f32>() * MAX_SPEED; let mut rand_pos_x: f32 = rand::random::<f32>() * WINDOW_X; let mut rand_pos_y: f32 = rand::random::<f32>() * WINDOW_Y; if rand_pos_x > WINDOW_X / 2. { rand_pos_x -= WINDOW_X; } if rand_pos_y > WINDOW_Y / 2. { rand_pos_y -= WINDOW_Y; } let rand_vel_x: f32 = rand_vel * rand_angle.cos(); let rand_vel_y: f32 = rand_vel * rand_angle.sin(); let asteroid = AsteroidBundle { health: Health { hp: 200 }, position: Position { x: rand_pos_x, y: rand_pos_y, }, velocity: Velocity { x_vel: rand_vel_x, y_vel: rand_vel_y, }, }; commands .spawn_bundle(SpriteBundle { sprite: Sprite { color: ASTEROID_COLOR, ..Default::default() }, transform: Transform { scale: Vec3::new(30.0, 30.0, 10.0), translation: Vec3::new(rand_pos_x, rand_pos_y, 10.0), ..Default::default() }, ..Default::default() }) .insert(asteroid.health) .insert(asteroid.position) .insert(asteroid.velocity);
} That is it for our startup systems! Using these we have been able to take our components and create entities made up of them and represent them on the screen! Please continue to the next chapter to make some systems that continuously run!

