The next system we are creating is critical for the player to play the game! This system takes the keyboard input and then will determine what the player's ship will do. The arrow keys will rotate the ship and the up arrow will accelerate. The down key will rotate the ship opposite of the direction it is travelling. fn player_input( keyboard_input: Res<Input<KeyCode>>, mut query: Query<( &mut Transform, &mut Velocity, &mut Direction, &Position, &Human, )>,
) { for (mut transform, mut velocity, mut direction, _position, _human) in query.iter_mut() { if keyboard_input.pressed(KeyCode::Left) { let prev_dir = direction.angle; direction.rotate_left(); let dir_change = direction.angle - prev_dir; transform.rotate(Quat::from_rotation_z(dir_change)); } if keyboard_input.pressed(KeyCode::Right) { let prev_dir = direction.angle; direction.rotate_right(); let dir_change = direction.angle - prev_dir; transform.rotate(Quat::from_rotation_z(dir_change)); } if keyboard_input.pressed(KeyCode::Down) { let dir_velocity: f32 = (velocity.y_vel / velocity.x_vel).atan(); let difference: f32 = direction.angle - dir_velocity; if difference < PI { let prev_dir = direction.angle; direction.rotate_right(); let dir_change = direction.angle - prev_dir; transform.rotate(Quat::from_rotation_z(dir_change)); } } if keyboard_input.pressed(KeyCode::Up) { velocity.accelerate(direction.angle); } }
}

