This system spawns a laser when the player presses the space bar. This is a combination of what we have learned in the player input and with our earlier startup systems. Combining those practices, we are able to spawn a new entity when the player presses the space bar. We also spawn it past the player's ship to avoid the new lasers from damaging the player. const LASER_COLOR: Color = Color::rgb(1.0, 0.0, 0.0); const BULLET_SPEED: f32 = 100.; fn spawn_laser( keyboard_input: Res<Input<KeyCode>>, query: Query<(&Velocity, &Direction, &Position, &Human)>, time: Res<Time>, mut commands: Commands,
