The despawn laser system is used to despawn a laser entity when it has reached its time limit that was determined upon spawning. fn despawn_laser( mut commands: Commands, time: Res<Time>, mut query: Query<(Entity, &mut ProjectileTimer)>,
) { for (entity, mut projectile) in query.iter_mut() { if projectile.timer.tick(time.delta()).just_finished() { projectile.elapsed = true; } if projectile.elapsed == true { commands.entity(entity).despawn(); } }
}

