The detect laser collision system is used to determine when a laser contacts another object, especially asteroids. When this happens we will remove a certain amount of hit points from the asteroid and then despawn the laser. If the entity that we hit with the laser goes below zero hit points we will also despawn that entity. fn detect_laser_collision( mut commands: Commands, laser_query: Query<(Entity, &Damage, &Transform)>, mut query: Query<(Entity, &Transform, &mut Health)>,
) { for (entity, transform, mut health) in query.iter_mut() { for (laser_entity, damage, laser_transform) in laser_query.iter() { let laser_size = laser_transform.scale.truncate(); let collision = collide( laser_transform.translation, laser_size, transform.translation, transform.scale.truncate(), ); if let Some(collision) = collision { health.hp = health.hp - damage.damage; if health.hp <= 0 { commands.entity(entity).despawn(); } commands.entity(laser_entity).despawn(); } } }
}

