Entities that are moving in space have a velocity. This component is used to store the velocity of the entity. We also are introducing an implementation here to our Velocity struct. This implementation is used to accelerate the velocity. This will be used when a player presses the accelerate button on their keyboard. We also are introducing a constant here, MAX_SPEED. This is a global constant that is used to set the maximum velocity for any entity. const MAX_SPEED: f32 = 100.; #[derive(Component)]
struct Velocity { x_vel: f32, y_vel: f32,
}
impl Velocity { fn accelerate(&mut self, direction: f32) { self.x_vel = self.x_vel + direction.cos(); self.y_vel = self.y_vel + direction.sin(); let squares: f32 = self.x_vel * self.x_vel + self.y_vel * self.y_vel; if squares > MAX_SPEED * MAX_SPEED { let current_speed: f32 = squares.sqrt(); self.x_vel *= MAX_SPEED / current_speed; self.y_vel *= MAX_SPEED / current_speed; } }
}
